	// Place your snippets for go here. Each snippet is defined under a snippet name and has a prefix, body and 
	// description. The prefix is what is used to trigger the snippet and the body will be expanded and inserted. Possible variables are:
	// $1, $2 for tab stops, $0 for the final cursor position, and ${1:label}, ${2:another} for placeholders. Placeholders with the 
	// same ids are connected.
	// Example:
	// "Print to console": {
	// 	"prefix": "log",
	// 	"body": [
	// 		"console.log('$1');",
	// 		"$2"
	// 	],
	// 	"description": "Log output to console"
	// }
	"table test" : {
		"prefix": ["table", "tb-test", "test"],
		"body": [
			"testCases := []struct {"
			"name       string",
			"compareObj map[string]interface{}",
			"stub       func(*testing.T, map[string]interface{}) (bool, error)",
			"check      func(*testing.T, bool, error)",
			"}{",
			"{",
			"name:       \"type invalid\",",
			"compareObj: map[string]interface{}{},",
			"stub:       func(t *testing.T, m map[string]interface{}) (bool, error) {},",
			"check:      func(t *testing.T, b bool, err error) {},",
			"},",
			"}",
			"for _, el := range testCases {",
			"t.Run(el.name, func(t *testing.T) {",
			"result, err := el.stub(t, el.compareObj)",
			"el.check(t, result, err)",
			"})",
			"}"
		]
	},
	"check error": {
		"prefix": ["cerr"],
		"body": [
			"if err != nil {",
			"\t$1",
			"}"
		]
	}
}"}}
